import React from 'react'
import { useNavigate } from 'react-router-dom'

const Home = () => {
    const navigate=useNavigate()

    function joinroom(event)
    {
        event.preventDefault()

        navigate("/editor/:")

    }
  return (
    <div>
        This is home page
        <div>
            <img src="Images\codecast.png" alt='codecollab'></img>
            <h1>enter the room id</h1>
            <input type='number' placeholder='Enter Room Id' className='text-black'></input><br></br>
            <input type='text' placeholder='Username' className='text-black'></input><br></br>
            <button onClick={joinroom}>Join</button>
            <p>Dont't have Room id ? create <span className="text-green-600">New Room Id</span></p>
        </div>
    </div>
  )
}
export default Home
